import React from 'react';

import TubeDBLogo from '../images/logo4.png';

import { Wrapper, Content, LogoImg } from './Header.styles';

import {
    Navbar,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink
  } from "shards-react";

class Header extends React.Component {
    render() {
        return(
            <Navbar type="dark" theme="primary" expand="md">
        <NavbarBrand href="/">CIS 550 FIFA</NavbarBrand>
          <Nav navbar>
          <NavItem>
          <LogoImg src={TubeDBLogo} alt='tubedb-logo' />
              <NavLink active href="/">
                Home
              </NavLink>
            </NavItem>
            <NavItem>
              <NavLink active href="/players">
                Players
              </NavLink>
            </NavItem>
            <NavItem>
              <NavLink active  href="/matches" >
                Matches
              </NavLink>
            </NavItem>
          </Nav>
      </Navbar>
        )
    }
}

export default Header;
